"""## **Manipulating Data - Part 1**"""

# changes the case of our string columns
# we can acess the string column of our dataframe using .str
car_sales["Make"].str.lower()

# it will reassign our Make column with the lowercase Make column
car_sales["Make"] = car_sales["Make"].str.lower()

car_sales_missing = pd.read_csv("/content/car-sales-missing-data.csv")

# empty value will be shown by NaN (Not a Number)
car_sales_missing

# it will take the odometer column and fill all the na places with the mean value of the odometer
car_sales_missing["Odometer"] = car_sales_missing["Odometer"].fillna(car_sales_missing["Odometer"].mean())

car_sales_missing["Odometer"].mean()

car_sales_missing

# if we use inplace=True then we do not need to reassign values in our DataFrame
# car_sales_missing["Odometer"].fillna(car_sales_missing["Odometer"].mean(), inplace=True)

car_sales_missing

# it will remove all the rows having na 
# and using inplace=True it will be assigned in our dataframe
car_sales_missing.dropna(inplace=True)

car_sales_missing

car_sales_missing = pd.read_csv("/content/car-sales-missing-data.csv")

# we have made a car_sales_missing_dropped datafraame and stored only the na rows
car_sales_missing_dropped = car_sales_missing.dropna()

car_sales_missing_dropped

car_sales_missing_dropped.to_csv("car-sales-missing-dropped.csv")

"""## **Manipulating Data - Part 2**"""

# column from series
seats_column = pd.Series([5, 5, 5, 5, 5])

# adding a new columns called seats in our dataframe
car_sales["Seats"] = seats_column
car_sales

# filling all na places of seats using 5
car_sales["Seats"].fillna(5, inplace=True)

car_sales

# creating a column from Python list
# creting a Fuel per 100KM column using fuel_economy list
# Note: List must be equal to the number of rows in the dataframe
fuel_economy = [5.2, 6.7, 9.2, 6.6, 4.7, 8.7, 3.0, 4.4, 1.4, 7.9]
car_sales["Fuel per 100KM"] = fuel_economy 
car_sales

# creating a new column Total fuel used with the help of dividing the Odometer (KM) by 100 then
# multiplying with the Fuel per 100KM of the car_sales dataframe
car_sales["Total fuel Used"] = car_sales["Odometer (KM)"]/100 * car_sales["Fuel per 100KM"]

car_sales

# adding Number of Wheels column
car_sales["Number of Wheels"] = 4

car_sales

# adding Passed Road Safety column that is boolean datatype
car_sales["Passed Road Safety"] = True

car_sales

# removing the Total fuel Used column
car_sales = car_sales.drop("Total fuel Used", axis=1)

car_sales

car_sales_completed_data = car_sales

car_sales_completed_data

car_sales_completed_data.to_csv("car_sales_completed.csv")

"""## **Manipulating Data - Part 3**"""

# index or order will be shuffled
car_sales_shuffled = car_sales.sample(frac=1)

car_sales

car_sales_shuffled

# select only 20% of data
car_sales_shuffled.sample(frac=0.2)

# it resets the index into original
# and drop deletes the index column 
car_sales_shuffled.reset_index(drop=True, inplace=True)
car_sales_shuffled

car_sales

# labda is a keyword used for anonymous function apply function to x into x / 1.6
car_sales["Odometer (KM)"] = car_sales["Odometer (KM)"].apply(lambda x: x/1.6)

car_sales

